import React from "react";
import Card from "../components/Card/Card";


let items = ["item1", "item2", "item3", "item4", "item5", "item6"];

const PizzaPage = () => {
  return (
    <div>
      <h2 className="content__title">Все пиццы</h2>
      <div className="content__items">
        {items.map((item) => (
          <Card />
        ))}
      </div>
    </div>
  );
};

export default PizzaPage;
